import React from "react";

function Temp() {
    const text = 'hello';
    const className = 'text'
    const myStyleForText = {
        color : 'red',
        margin : '0 auto',
        textAlign : 'center'
    };

    return (
        <React.Fragment>
            <h1
                className={className}
                style={myStyleForText}
            >
                {text}
            </h1>
        </React.Fragment>
    )
}

class TempClass extends React.Component {
    render() {
        const text = 'hello';
        const className = 'text'
        const myStyleForText = {
            color : 'red',
            margin : '0 auto',
            textAlign : 'center'
        };

        return(
          <React.Fragment>
              <h1
              className={className}
              style={myStyleForText}
              >
                  {text}
              </h1>
          </React.Fragment>
        );
    }
}

export {TempClass};
export default Temp;
